import React from "react";
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'

import "../CSS/App.css"
import Navbar from "../pages/navbar";
import Home from "../pages/home";
import Login from "../pages/login";
import Register from "../pages/register";
import Footer from "../components/footer";
import bookspedia from "../bookspedia";
import "../images"


function App() {

    function createBook(book) {
        return (
            <Home
                key={book.id}
                name={book.name}
                image={book.image}
                category={book.category}
                rating={book.rating}
            />
        );
    }

    // chrome.runtime.onMessage.addListener(function (msg, sender, sendResponse) {
    //     // do something ...

    //     // this line seems meaningless but you have to invoke it to avoid error.
    //     sendResponse({ damn: true });
    // });
    return (
        <div className="App">
            {/* <Header /> */}
            <Router>
                <Navbar />
                <Routes>
                    <Route exact path="/" element={<Home />} />
                    <Route exact path="/login" element={<Login />} />
                    <Route exact path="register" element={<Register />} />
                </Routes>
            </Router>
            {bookspedia.map(createBook)}
            {/* <dl className="dictionary">
                {bookspedia.map(emojiTerm => (
                    <Home
                        key={emojiTerm.id}
                        image={emojiTerm.image}
                        name={emojiTerm.name}
                        category={emojiTerm.category}
                        rating={emojiTerm.rating}
                        bookmark={emojiTerm.bookmark} />))}
            </dl> */}
            <Footer />
        </div>
    );
}

export default App;
